            opacity: 0;
        }

        .swiper-slide .play img {
            width: 40px;
            object-fit: contain;
            margin-bottom: 80px;
            height: fit-content;
        }

        .ab_block {
            display: flex;
            color: #fff;
            width: 100%;
            height: 100%;
            align-items: center;
            justify-content: center;
        }

        .sound_on {
            display: none;
        }

        .sound_off {
            display: block;
        }

        .toggle-sound__on .sound_on {
            display: block;
        }

        .toggle-sound__on .sound_off {
            display: none;
        }

        .dev-show {
            font-size: 32px;
            font-weight: 600;
            color: white;
            text-shadow: -1px 0px 2px black;
            z-index: 100;
            position: absolute;
        }

        .comment_wrap {
            display: none;
            align-items: center;
            justify-content: center;
            position: absolute;
            bottom: 0;
            width: 100%;
            z-index: 1;
            background-color: #fff;
            border-top-right-radius: 10px;
            border-top-left-radius: 10px;
            padding: 28px 20px 15px;
            box-sizing: border-box;
            flex-direction: column;
        }

        .comment_top {
            display: flex;
            align-items: center;
            justify-content: flex-start;
            width: 100%;
            margin-bottom: 15px;
        }

        .comment_avatar {
            width: 30px;
            height: 30px;
            border-radius: 50%;
            border: 2px solid #fe2c55;
            overflow: hidden;

        }

        .comment_avatar img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .comment_text {
            display: inline-block;
            margin: 0 10px;
            width: 80%;
        }

        .comment_text span {
            color: #00aaf7;
            text-decoration: underline;
            cursor: pointer;
        }

        .comment_likes {
            display: flex;
            align-items: center;
            flex-direction: column;
            justify-content: center;
            margin-left: auto;
        }

        .comment_likes img {
            width: 15px;
            object-fit: contain;
            margin-bottom: 4px;
        }

        .comment_likes_count {
            font-size: 10px;
            color: #565656;
        }

        .comment_bottom {
            display: flex;
            color: #00aaf7;
            /* font-weight: bold; */
            font-size: 14px;
            cursor: pointer;
        }

        @keyframes pl__slideInUp {
            from {
                -webkit-transform: translate3d(0, 100%, 0);
                transform: translate3d(0, 100%, 0);
                visibility: visible;
            }

            to {
                -webkit-transform: translate3d(0, 0, 0);
                transform: translate3d(0, 0, 0);
            }
        }

        .pl__slideInUp {
            -webkit-animation-name: pl__slideInUp;
            animation-name: pl__slideInUp;
            animation-duration: 1s;
        }

        .comment_close {
            position: absolute;
            top: 5px;
            right: 5px;
            display: flex;
            align-items: center;
            justify-content: center;
            width: 15px;
            height: 15px;
            padding: 5px;
        }

        .comment_close {
            position: absolute;
            top: 5px;
            right: 5px;
            display: flex;
            align-items: center;
            justify-content: center;
            width: 10px;
            height: 10px;
            padding: 5px;
        }

        .footer-icons .notif {
            position: relative;
        }

        .shape-container {
            position: absolute;
            right: 2px;
            width: 13px;
            height: 13px;
            align-items: center;
            justify-content: center;
            top: -5px;
            display: flex;
            align-items: center;
            justify-self: center;
        }

        .footer-icons span.shape-count {
            z-index: 999;
            margin: auto;
            letter-spacing: 0;
            position: absolute;
            margin-top: 0;
            font-size: 9px !important;
        }

        .shape-wrapper {
            position: relative;
        }

        .heart {
            position: relative;
        }

        .shape-container.pulsing .shape-pulse {
            transform: scale(2.3, 2.3);
            opacity: 0;
            transition: transform 1s ease-in-out, opacity 1s ease-in-out;


        }

        .shape-container .shape-pulse {
            transition: none;
            transform: scale(1, 1);
            opacity: 1;
        }

        .shape {
            position: absolute;
            right: 0;
            width: 23px;
            height: 23px;
            align-items: center;
            justify-content: center;
            top: 0;
        }

        .heart>div:nth-child(1) {
            border-radius: 50%;
            left: 0;
            top: 11%;
        }

        .heart>div:nth-child(2) {
            position: absolute;
            border-radius: 50%;
            top: 11%;
            right: 0;
        }

        .heart>div:nth-child(3) {
            position: absolute;
            transform: rotate(45deg);
            border-radius: 15% 0 15% 0;
            width: 58%;
            height: 58%;
            right: 21%;
            bottom: 11%;
        }

        .progress-duration {
            margin-left: 5px;
            font-size: 0.7em;
            color: #000;
            opacity: 0;
            transition: all 0.3s ease;
            position: absolute;
            bottom: 100px;
            z-index: 9999;
        }

        .progress-range {
            position: absolute;
            top: -2px;
            z-index: 9999;
            height: 4px;
            margin: 0;
            width: 100%;
            background-color: #fff;
            cursor: pointer;
            transition: all 0.4s ease;
            border-radius: 0;
            left: 0;
            right: 0;
            margin: auto;

        }

        .progress-range:hover {
            height: 5px;
        }

        .progress-bar {
            border-radius: 100px;
            height: 100%;
            width: 1%;
            transition: width 0.3s ease;
            background: linear-gradient(90deg,
                    rgba(238, 29, 82, 1) 0%,
                    rgba(255, 255, 255, 1) 34%,
                    rgba(105, 201, 208, 1) 65%);
        }

        .progress-range:hover .progress-duration {
            opacity: 1;
        }

        .heart>div {
            background-color: red;
            position: absolute;
            width: 55%;
            height: 55%;
        }

        .shape-pulse {
            transition: transform 1s ease-in-out, opacity 1s ease-in-out;
            position: absolute;
            opacity: 0.5;
            transform: scale(1, 1);
            top: 0;
            left: 0;
        }

        .heart {
            position: relative;
        }

        .footer-icons span.plus {
            background-color: #fff;
            color: #000;
            display: flex;
            font-size: 17px;
            padding: 10px 10px;
            border-radius: 6px;
            border-right: 5px solid #fd033a;
            border-left: 5px solid #1fd5ec;
            align-items: center;
            justify-content: center;
            text-transform: uppercase;
            font-weight: 700;
            letter-spacing: 1px;
        }

        .footer-icons .notif.pulse {
            animation-duration: 1s;
            animation-name: pulse;
        }
    </style>
</head>
